import styled from "styled-components";

export const Overlay = styled.div`
  position: absolute;
  top: ${props => (props.topNavOverlay ? "50px" : "0px")};
  left: 0;
  width: 100vw;
  height: 100vh;
  background-color: #0000003b;
  background-color: var(--Overlay);
  z-index: 9;
`;
